function migratoryBirds($arr) {
    $values = array_count_values($arr);
    var_dump($values);
    natsort($values);
    var_dump($values);
    arsort($values);
    var_dump($values);
    $duplicateTotals = array_count_values($values);
    var_dump($values, $duplicateTotals, array_pop($values));
    if(reset($duplicateTotals) > 1) {
        return key(array_pop($values));
    }
    return key($values);
}

